pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Base64.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

import "./libraries/HexStrings.sol";

import "./SVGConstants.sol";
import "./SVGComponents.sol";

import "hardhat/console.sol";

contract NFTDescriptor is SVGConstants, SVGComponents {
    using SafeMath for uint256;
    using Strings for uint256;
    using HexStrings for uint256;

    function encodeSVG(
        uint256 _tokenId,
        address _ownerAddress,
        uint256 _supportAmount,
        address _tokenAddress,
        string memory _fundName,
        string memory _fundFocus
    ) public view returns (string memory) {
        return
            Base64.encode(
                _buildSVG(
                    _tokenId,
                    _ownerAddress,
                    _supportAmount,
                    _tokenAddress,
                    _fundName,
                    _fundFocus
                )
            );
    }

    function buildSVG(
        uint256 _tokenId,
        address _ownerAddress,
        uint256 _supportAmount,
        address _tokenAddress,
        string memory _fundName,
        string memory _fundFocus
    ) public view returns (string memory) {
        return
            string(
                _buildSVG(
                    _tokenId,
                    _ownerAddress,
                    _supportAmount,
                    _tokenAddress,
                    _fundName,
                    _fundFocus
                )
            );
    }

    function _buildSVG(
        uint256 _tokenId,
        address _ownerAddress,
        uint256 _supportAmount,
        address _tokenAddress,
        string memory _fundName,
        string memory _fundFocus
    ) public view returns (bytes memory) {
        bytes[3] memory colors = [
            tokenToColorHex(_ownerAddress, 77),
            tokenToColorHex(_ownerAddress, 136),
            tokenToColorHex(_ownerAddress, 17)
        ];

        string memory supportAmount = (_supportAmount /
            10**ERC20(_tokenAddress).decimals()).toString();

        bytes memory dynamicLayer = abi.encodePacked(
            sideText(_tokenId.toString(), "rotate(90 132.5 142.5)", "start"),
            sideText(
                addressToString(_ownerAddress),
                "rotate(90 -107.5 382.5)",
                "end"
            ),
            titleStack(30, 110, "Fund", abi.encodePacked(_fundName)),
            titleStack(30, 180, "Focus", abi.encodePacked(_fundFocus)),
            titleStack(
                30,
                250,
                "Donation",
                abi.encodePacked(
                    supportAmount,
                    " ",
                    ERC20(_tokenAddress).symbol()
                )
            ),
            colorToGridAnim(colors)
        );

        return
            abi.encodePacked(
                '<svg width="290" height="500" viewBox="0 0 290 500" xmlns="http://www.w3.org/2000/svg">',
                styleConstant,
                shapes,
                logoConstant,
                dynamicLayer,
                "</svg>"
            );
    }

    function addressToString(address _address)
        internal
        pure
        returns (string memory)
    {
        return (uint256(uint160(_address))).toHexStringASCII(20);
    }

    function tokenToColorHex(address token, uint256 offset)
        internal
        pure
        returns (bytes memory str)
    {
        return
            abi.encodePacked(
                "#",
                (uint256(uint160(token)) >> offset).toHexStringASCIINoPrefix(3)
            );
    }
}
","keccak256":"0x6241bced447e12b0153cd550ce722b152ade6aade298e7eeb300428542df8b15","license":"MIT"},"contracts/SVGComponents.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Strings.sol";

contract SVGComponents {
    using Strings for uint256;

    function colorToGridAnim(bytes[3] memory _colors)
        internal
        pure
        returns (bytes memory)
    {
        return
            abi.encodePacked(
                '<defs><linearGradient id="grad-anim" x1="0%" y1="0%" x2="100%" y2="100%">',
                stopTag(_colors, "0%"),
                stopTag([_colors[1], _colors[0], _colors[2]], "100%"),
                "</linearGradient></defs>"
            );
    }

    function stopTag(bytes[3] memory _colors, bytes memory _offset)
        internal
        pure
        returns (bytes memory)
    {
        return
            abi.encodePacked(
                '<stop offset="',
                _offset,
                '" stop-color="',
                _colors[0],
                '"><animate attributeName="stop-color" values="',
                _colors[0],
                ";",
                _colors[2],
                ";",
                _colors[1],
                ";",
                _colors[0],
                '" dur="7s" repeatCount="indefinite"/></stop>'
            );
    }

    function sideText(
        string memory _text,
        bytes memory _transform,
        bytes memory _anchor
    ) internal pure returns (bytes memory) {
        return
            abi.encodePacked(
                '<text class="small" transform="',
                _transform,
                '" style="text-anchor:',
                _anchor,
                '" fill="#FFF">',
                _text,
                "</text>"
            );
    }

    function titleStack(
        uint256 _x,
        uint256 _y,
        bytes memory _sub,
        bytes memory _title
    ) internal pure returns (bytes memory) {
        return
            abi.encodePacked(
                '<text class="title" transform="translate(',
                _x.toString(),
                ",",
                _y.toString(),
                ')"><tspan class="large" x="0">',
                _sub,
                '</tspan><tspan class="small alpha" x="0" dy="20">',
                _title,
                "</tspan></text>"
            );
    }
}
